import request from '@/utils/request'

let apiURL = {
    // 表
    qryTable: '/api/searchPage/qryTable',
    // API
    qryAPI: '/api/searchPage/qryAPI',
    // 指标
    qryTarget: '/api/searchPage/qryTarget',
    // 标签
    qryTag: '/api/searchPage/qryTag',
    // 树形控件
    qryTreeData: '/api/searchPage/qryTreeData'
}
export const searchPage = {
    qryTable: (params) => {
        return request({
            url: apiURL.qryTable,
            method: 'get',
            data: params,
        })
    },
    qryAPI: (params) => {
        return request({
            url: apiURL.qryAPI,
            method: 'get',
            data: params,
        })
    },
    qryTarget: (params) => {
        return request({
            url: apiURL.qryTarget,
            method: 'get',
            data: params,
        })
    },
    qryTag: (params) => {
        return request({
            url: apiURL.qryTag,
            method: 'get',
            data: params,
        })
    },
    qryTreeData: (params) => {
        return request({
            url: apiURL.qryTreeData,
            method: 'get',
            data: params,
        })
    },
}
